CREATE PROCEDURE dbo.proc_transform_109
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_109
    SET payload = LEFT(payload, 1000) + N'|V4-109|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_109;
END
